pragma solidity >= 0.6.0 <=0.7.0;

library SafeMath {
    
    function add(uint256 a, uint256 b) internal pure returns (uint256) {
        uint256 c = a + b;
        require(c >= a, "SafeMath: addition overflow");

        return c;
    }

    function sub(uint256 a, uint256 b) internal pure returns (uint256) {
        require(b <= a, "SafeMath: subtraction overflow");
        uint256 c = a - b;

        return c;
    }

    function mul(uint256 a, uint256 b) internal pure returns (uint256) {

        if (a == 0) {
            return 0;
        }

        uint256 c = a * b;
        require(c / a == b, "SafeMath: multiplication overflow");

        return c;
    }

    function div(uint256 a, uint256 b) internal pure returns (uint256) {
        // Solidity only automatically asserts when dividing by 0
        require(b > 0, "SafeMath: division by zero");
        uint256 c = a / b;
        // assert(a == b * c + a % b); // There is no case in which this doesn't hold

        return c;
    }

    function mod(uint256 a, uint256 b) internal pure returns (uint256) {
        require(b != 0, "SafeMath: modulo by zero");
        return a % b;
    }
}

contract ReentrancyGuard {
    bool private _notEntered;

    constructor () internal {
        _notEntered = true;
    }

    modifier nonReentrant() {
         require(_notEntered, "ReentrancyGuard: reentrant call");

        _notEntered = false;

        _;
 _notEntered = true;
    }
}

contract Context {
   
    constructor () internal { }
    
    function _msgSender() internal view returns (address payable) {
        return msg.sender;
    }

    function _msgData() internal view returns (bytes memory) {
        this; // silence state mutability warning without generating bytecode - see https://github.com/ethereum/solidity/issues/2691
        return msg.data;
    }
}

contract Ownable is Context {
    address private _owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    constructor () internal {
        address msgSender = _msgSender();
        _owner = msgSender;
        emit OwnershipTransferred(address(0), msgSender);
    }

    function owner() public view returns (address) {
        return _owner;
    }

    modifier onlyOwner() {
        require(isOwner(), "Ownable: caller is not the owner");
        _;
    }

    function isOwner() public view returns (bool) {
        return _msgSender() == _owner;
    }

    function renounceOwnership() public virtual onlyOwner {
        emit OwnershipTransferred(_owner, address(0));
        _owner = address(0);
    }

    function transferOwnership(address newOwner) public virtual onlyOwner {
        _transferOwnership(newOwner);
    }

    function _transferOwnership(address newOwner) internal virtual {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        emit OwnershipTransferred(_owner, newOwner);
        _owner = newOwner;
    }
}

contract Pause is Ownable {
    
    event Paused(address account);
    event Unpaused(address account);
 
    bool private _paused = false;
   
    function paused() public view  returns (bool) {
        return _paused;
    }
   
    function pause() public onlyOwner whenNotPaused {
        _pause();
    }
   
    function _pause() internal {
        _paused = true;
        emit Paused(msg.sender);
    }
 
    function unpause() public  onlyOwner whenPaused {
        _unpause();
    }
   
    function _unpause() internal {
        _paused = false;
        emit Unpaused(msg.sender);
    }

    modifier whenNotPaused() {
        require(!_paused, "Pausable: paused");
        _;
    }

    modifier whenPaused() {
        require(_paused, "Pausable: not paused");
        _;
    }
}

contract SimpleToken_IERC20 is Context{
    using SafeMath for uint256;

    string public name;
    string public symbol;
    uint8 public decimals;
    uint public _totalSupply;
    
    mapping (address => uint256) private _balances; //колличество токенов у держателя 

    mapping (address => mapping (address => uint256)) private _allowances;
    
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);

    constructor (uint totalSuply, string memory _symbol, string memory _name, uint8 _decimals) public {
        _mint(_msgSender(), totalSuply);
        symbol = _symbol;
        name = _name;
        decimals = _decimals;
    }

    function totalSupply() public view returns (uint256) {
        return _totalSupply.sub(_balances[address(0)]);
    }

    function balanceOf(address account) public view returns (uint256) {
        return _balances[account];
    }

    function transfer(address recipient, uint256 amount) public virtual returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }
    
    function allowance(address owner, address spender) public view virtual returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address owner, address spender, uint256 value) public virtual returns (bool) {
        require(balanceOf(owner) >= value, 'token: you does not have so many tokens');
        _approve(owner, spender, value);
        return true;
    }
    
    function transferFrom(address sender, address recipient, uint256 amount) public virtual returns (bool) {
    	require(_allowances[sender][msg.sender] >= amount, "don`t have allowances");
        _transfer(sender, recipient, amount);
        _approve(sender, _msgSender(), _allowances[sender][_msgSender()].sub(amount));
        return true;
    }

    function increaseAllowance(address __owner, address spender, uint256 addedValue) public virtual returns (bool) {
        require(balanceOf(__owner)>=  _allowances[__owner][spender].add(addedValue), 'token: you does not have so many tokens');
        _approve(__owner, spender, _allowances[__owner][spender].add(addedValue));
        return true;
    }

    function decreaseAllowance(address __owner, address spender, uint256 subtractedValue) public virtual returns (bool) {
  	    require(_allowances[__owner][spender] >= subtractedValue, "don`t have allowance");
        _approve(__owner, spender, _allowances[__owner][spender].sub(subtractedValue));
        return true;
    }

    function _transfer(address sender, address recipient, uint256 amount) internal virtual {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");
        
        _balances[sender] = _balances[sender].sub(amount);
        _balances[recipient] = _balances[recipient].add(amount);
        _approve(recipient, recipient, _balances[recipient]);
        emit Transfer(sender, recipient, amount);
    }

    function _approve(address owner, address spender, uint256 value) internal {  
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = value;
        emit Approval(owner, spender, value);
    }
    
    function _mint(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: mint to the zero address");
        _totalSupply = _totalSupply.add(amount);
        _balances[account] = _balances[account].add(amount);
        emit Transfer(address(0), account, amount);
    }
    
    function _burn(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: burn from the zero address");

        _balances[account] = _balances[account].sub(amount);
        _totalSupply = _totalSupply.sub(amount);
        emit Transfer(account, address(0), amount);
    }

    function _burnFrom(address account, uint256 amount) internal virtual {
        _burn(account, amount);
        _approve(account, _msgSender(), _allowances[account][_msgSender()].sub(amount));
    }
}

contract Crowdsale is Pause, ReentrancyGuard {
    using SafeMath for uint256;
    
    SimpleToken_IERC20 private _token;

    address payable private _wallet; 

    uint256 private _rate;

    uint256 public _weiRaised;
    
    mapping(address => uint256) private _contributions;
    address[] _investors;
 
    event ClaimedTokens(address indexed _token, address indexed _controller, uint _amount);
    event TokensPurchased(address indexed purchaser, address indexed beneficiary, uint256 value, uint256 amount);
    
    constructor( uint totalSupply, string memory symbol, string memory name, uint8 decimals, address payable wallet,uint rate) public {
        _token = new SimpleToken_IERC20(totalSupply, symbol,name, decimals);
        _rate = rate;
        _wallet = wallet;
    }
    
    receive() external payable  {
        buyTokens(_msgSender());
    }

    function get_ether(uint a) external onlyOwner {
        require( a <= address(this).balance, 'Crowdsale: contrat does not have so much ether');
        return _wallet.transfer(a);
    }
    
    function totalSupply() public view returns(uint) {
        return _token.totalSupply();
    }

    function balanceOf(address account) public view returns(uint) {
        return _token.balanceOf(account);
    }

    function allowance(address owner, address spender) public view returns (uint256) {
        return _token.allowance(owner, spender);
    }
 
    function approve(address spender, uint256 value) public returns (bool) {
        return _token.approve(_msgSender(),spender, value);
    }
   
      function increaseAllowance(address spender, uint256 addedValue) public returns (bool) {
        return _token.increaseAllowance(_msgSender(), spender, addedValue);
    }
 
    function decreaseAllowance(address spender, uint256 subtractedValue) public returns (bool) {
        return _token.decreaseAllowance(_msgSender(), spender, subtractedValue);
    }
   
      function token() public view returns (SimpleToken_IERC20) {
        return _token;
    }
 
    function wallet() public view returns (address payable) {
        return _wallet;
    }
 
    function rate() public view returns (uint256) {
        return _rate;
    }
 
    function weiRaised() public view returns (uint256) {
        return _weiRaised;
    }

    function buyTokens(address beneficiary) public nonReentrant whenNotPaused payable {//всегда
        uint256 weiAmount;
        weiAmount = msg.value;
        
        _preValidatePurchase(beneficiary, weiAmount);

        uint256 tokens = _getTokenAmount(weiAmount);

        _weiRaised = _weiRaised.add(weiAmount);

        _processPurchase(beneficiary, tokens);
        _updatePurchasingState(beneficiary, weiAmount);
        emit TokensPurchased(_msgSender(), beneficiary, weiAmount, tokens);
     
        _forwardFunds();
        _postValidatePurchase(beneficiary, weiAmount);
    }

    function _preValidatePurchase(address beneficiary, uint256 weiAmount) internal view {
        require(beneficiary != address(0), "Crowdsale: beneficiary is the zero address");
        require(weiAmount != 0, "Crowdsale: weiAmount is 0");
        this;
    }
    
    function _postValidatePurchase(address beneficiary, uint256 weiAmount) internal {
        _contributions[beneficiary] = _contributions[beneficiary].add(weiAmount);
        _investors.push(beneficiary);
    }
 
    function _updatePurchasingState(address beneficiary, uint256 weiAmount) internal {
       
    }
   
    function _deliverTokens(address beneficiary, uint256 tokenAmount) internal {
        _token.transfer(beneficiary, tokenAmount);
        
    }
 
    function _processPurchase(address beneficiary, uint256 tokenAmount) internal {
        _deliverTokens(beneficiary, tokenAmount);
    }
 
    function _getTokenAmount(uint256 weiAmount) internal view returns (uint) {
        return weiAmount.mul(_rate);

    }
 
    function _forwardFunds() internal {
        _wallet.transfer(msg.value);
    }
    
    /*
     @notice This method can be used by the owner to extract mistakenly
     sent tokens to this contract.
     @param _token The address of the token contract that you want to recover
     set to 0 in case you want to extract ether.
    */
    function claimTokens(address __token) public onlyOwner {
        if (__token == address(0x0)) {
            _wallet.transfer(address(this).balance); //перепроверить
            return;
        }

        SimpleToken_IERC20 token1 = SimpleToken_IERC20(__token);
        uint256 balance = token1.balanceOf(address(this));
        token1.transfer(owner(), balance);
        emit ClaimedTokens(__token, owner(), balance);
    }

}
